<template>
	<view class="exchange-body">
		<view class="exchange-mian">
			<view class="receive">
				<view class="first"><input v-model="information.cardNumber" placeholder="请输入卡号" /></view>
				<view class="second"><input  v-model="information.cardPassword" placeholder="请输入密码" /></view>
				<view class="button"><button @click="claimCard">卡券验证</button></view>
			</view>
		</view>
	</view>
</template>
<script>
	import http from '@/api/http.js';
import { gift } from '@/api/interface.js';
export default {
	data() {
		return {
			information: {
				cardNumber: '',
				cardPassword: '',
				sendState: '2'
			}
		};
	},
	onShow(){
		// #ifdef H5
		this.$routers.refreshH5();
		// #endif
	},
	mounted() {},
	methods: {
		claimCard() {
			if (this.information.cardNumber == '' || this.information.cardPassword == '') {
				this.$message.alert('请填写必填项')
			}
			else {
				let params = this.information;
				http.get(gift.receiveCard, params).then(res => {
					if (res.success) {
						this.$message.alert(res.msg)
						setTimeout(()=>{
							this.$routers.push('welfare')
						},1000)
					} else {
						this.$message.alert(res.msg)
					}
				});
			}
		}
	}
};
</script>
<style lang="less" scoped>
.exchange-body {
	height: 1448rpx;
	background: url('data:image/png;base64,')
		no-repeat;
	/* #ifndef H5 */
	background-size: 750rpx 1448rpx;
	height: 1448rpx;
	/* #endif */
	/* #ifdef H5 */
	background-size:  100vw 100vh;
	height: 100vh;
	/* #endif */

	.exchange-mian {
		/* #ifdef H5 */
		display: flex;
		justify-content: center;
		align-items: center;
		height: 100vh;
		/* #endif */
		.receive {
			width: 600rpx;
			height: 435rpx;
			/* #ifndef H5 */
			position: absolute;
			left: 10%;
			top: 70vw;
			/* #endif */
			/* #ifdef H5 */
			display: flex;
			flex-direction: column;
			/* #endif */
			border-radius: 25rpx;
			.first {
				width: 485rpx;
				height: 85rpx;
				margin: 9vw auto 0 auto;
				input {
					font-size: 32rpx;
					width: 485rpx;
					height: 80rpx;
					border-radius: 90rpx;
					padding-left: 30rpx;
					// // line-height: 85px;
					background-color: #ebeff2;
				}
			}
			.second {
				width: 485rpx;
				height: 85rpx;
				margin: 30rpx auto 35rpx auto;
				input {
					font-size: 32rpx;
					width: 485rpx;
					height: 80rpx;
					border-radius: 90rpx;
					padding-left: 30rpx;
					background-color: #ebeff2;
					// line-height: 85px;
					background-color: #ebeff2;
					color: #000;
				}
			}
			.button {
				
				width: 560rpx;
				height: 85rpx;
				margin: 0 auto;
				/* #ifdef H5 */
				padding-top: 40rpx;
				margin-top: 35rpx;
				/* #endif */
				/* #ifndef H5 */
				padding-top: 80rpx;
				/* #endif */
				border-top: 2px solid transparent;
				background: linear-gradient(#ffffff,#ffffff)  padding-box ,
				repeating-linear-gradient(90deg,#fff 0, #fff 0.2em,#fff 0.2em,#fff 0.4em,#EBEFF2 0.4em, #EBEFF2 1.8em,#fff 0.8em,#fff 1em);
				display: flex;
				justify-content: center;
				button {
					font-size: 32rpx;
					width: 485rpx;
					height: 80rpx;
					line-height: 80rpx;
					background-color: #EB2B27;
					//  background: url(../../../assets/gift/bt.png);
					border-radius: 50rpx;
					color: #fff;
				}
			}
		}
	}
}
</style>
